  constructor(props) {
    super(props);
    this.state = {
      issaveprofile: true
    };
  }
  render() {
    return (
      <div className="">
        <div className="">
              <SaveProfile />
              {/* <setProfile /> */} 
        </div>
      </div>
    );
  }
}
